import React from 'react';
import {
  Button,
  Container,
  Header,
  Image,
  Segment,
  List,
  Divider,
} from 'semantic-ui-react';
import { Link, withRouter } from 'react-router-dom';

const NavBar = ({ history, currentUser, logout, signUp }) => {
  const guestButtons = (
    <>
      <List floated='right' horizontal>
        <Button
          content='Login'
          floated='right'
          onClick={() => history.push('/login')}
          color='red'
        />
        <Button

          content='Sign Up'
          onClick={() => history.push('/signup')}
          color='red'
        />
      </List>
    </>
  );

  const authButtons = (
    <List horizontal> 
      <Button
        onClick={() => history.push('/search')}
        inverted
        color='red'
        content='Search'
      />

      <Button
        content='Profile'
        onClick={() => history.push('/profile')}
        inverted
        color='red'
      />
      <Button inverted content='Logout' color='red' onClick={logout} />
    </List>
  );
  return (
    <>
      <h1>
        <Link to='/'>
          <Header floated='left' as='h2' color='red' textAlign='center'>
            Telemed
            <Image src='../favicon.ico' />
          </Header>
        </Link>
      </h1>

      {currentUser ? authButtons : guestButtons}
      <Divider hidden />
      </>

  );
};

export default withRouter(NavBar);
